import React from 'react';
import { DataGrid } from '@mui/x-data-grid';
import { Button } from '@mui/material';

const ExerciseTable = ({ exercises, onEditExercise, onDeleteExercise }) => {
  const columns = [
    { field: 'title', headerName: 'Title', width: 200 },
    { field: 'description', headerName: 'Description', width: 400 },
    {
      field: 'actions',
      headerName: 'Actions',
      renderCell: (params) => (
        <div>
          <Button onClick={() => onEditExercise(params.row)} color="primary">
            Edit
          </Button>
          <Button onClick={() => onDeleteExercise(params.row.id)} color="secondary">
            Delete
          </Button>
        </div>
      ),
      width: 150,
    },
  ];

  return (
    <div style={{ height: 400, width: '100%' }}>
      <DataGrid rows={exercises} columns={columns} pageSize={5} />
    </div>
  );
};

export default ExerciseTable;
